import React from 'react';

class ObjetoPokemon extends React.Component {
    render () {
        const {name, type, image} = this.props.pokemon;
        return(
            <ul>
                <li><strong>{name}</strong></li>
                <li>{type}</li>
                <li>{image}</li>
            </ul>
        )
    }
}

export default ObjetoPokemon
